// @import \"generic/normalize\";\n\n/* Box sizing\n--------------------------------------------- */\n// @import \"generic/box-sizing\";\n\n/*--------------------------------------------------------------\n# Base\n--------------------------------------------------------------*/\n@import \"base/base\";\n\n/*--------------------------------------------------------------\n# Layouts\n--------------------------------------------------------------*/\n// @import \"layouts/content-sidebar\"; // Uncomment this line for a sidebar on right side of your content.\n// @import \"layouts/sidebar-content\"; // Uncomment this line for a sidebar on left side of your content.\n\n/*--------------------------------------------------------------\n# Components\n--------------------------------------------------------------*/\n@import \"components/components\";\n\n/*--------------------------------------------------------------\n# Utilities\n--------------------------------------------------------------*/\n\n/* Accessibility\n--------------------------------------------- */\n// @import \"utilities/accessibility\";\n\n/* Alignments\n--------------------------------------------- */\n// @import \"utilities/alignments\";\n","// _reset.scss\r\n\r\n/* http://meyerweb.com/eric/tools/css/reset/ \r\nv2.0 | 20110126\r\nLicense: none (public domain)\r\n*/\r\nhtml, body, div, span, applet, object, iframe,\r\nh1, h2, h3, h4, h5, h6, p, blockquote, pre,\r\na, abbr, acronym, address, big, cite, code,\r\ndel, dfn, em, img, ins, kbd, q, s, samp,\r\nsmall, strike, strong, sub, sup, tt, var,\r\nb, u, i, center,\r\ndl, dt, dd, ol, ul, li,\r\nfieldset, form, label, legend,\r\ntable, caption, tbody, tfoot, thead, tr, th, td,\r\narticle, aside, canvas, details, embed, \r\nfigure, figcaption, footer, header, hgroup, \r\nmenu, nav, output, ruby, section, summary,\r\ntime, mark, audio, video {\r\nmargin: 0;\r\npadding: 0;\r\nborder: 0;\r\nfont-size: 100%;\r\nfont: inherit;\r\nvertical-align: baseline;\r\n}\r\n/* HTML5 display-role reset for older browsers */\r\narticle, aside, details, figcaption, figure, \r\nfooter, header, hgroup, menu, nav, section {\r\ndisplay: block;\r\n}\r\nbody {\r\nline-height: 1;\r\n}\r\nol, ul {\r\nlist-style: none;\r\n}\r\nblockquote, q {\r\nquotes: none;\r\n}\r\nblockquote:before, blockquote:after,\r\nq:before, q:after {\r\ncontent: '';\r\ncontent: none;\r\n}\r\ntable {\r\nborder-collapse: collapse;\r\nborder-spacing: 0;\r\n}","* {\r\n    margin: 0;\r\n    padding:0;\r\n    -webkit-box-sizing:border-box;\r\n    -moz-box-sizing:border-box;\r\n    -ms-box-sizing:border-box;\r\n    box-sizing: border-box;\r\n    font-weight: normal;\r\n}\r\n\r\nhtml {\r\n    scroll-behavior: smooth;\r\n    font-size: 62.5%;\r\n}\r\n\r\nbody {\r\n    -webkit-text-size-adjust: 100%;\r\n    word-wrap: break-word;\r\n    overflow-wrap: break-word;\r\n    font-variant-ligatures: none;\r\n    font-family: \"kozuka-gothic-pro\",sans-serif;\r\n    font-weight: 400;\r\n    font-style: normal;\r\n}\r\na,a:hover {\r\n    text-decoration: none;\r\n    color: #000;\r\n    transition: 0.5s;\r\n}\r\n\r\nimg {\r\n    vertical-align: bottom;\r\n    width: 100%;\r\n    height: auto;\r\n}\r\n\r\n.d-fl {\r\n    display: -webkit-box;\r\n    display: -moz-box;\r\n    display: -ms-box;\r\n    display: -webkit-flexbox;\r\n    display: -moz-flexbox;\r\n    display: -ms-flexbox;\r\n    display: -webkit-flex;\r\n    display: -moz-flex;\r\n    display: -ms-flex;\r\n    display: flex;\r\n    -webkit-box-lines: multiple;\r\n    -moz-box-lines: multiple;\r\n    -webkit-flex-wrap: wrap;\r\n    -moz-flex-wrap: wrap;\r\n    -ms-flex-wrap: wrap;\r\n    flex-wrap: wrap;\r\n}\r\n\r\n.sp{\r\n    display: none;\r\n    @include mqSp{\r\n        display: block;\r\n    }\r\n}\r\n\r\n.pc{\r\n    display: block;\r\n    @include mqSp{\r\n        display:none;\r\n    }\r\n}\r\n","// _media.scss\r\n@mixin mqPc() {\r\n    @media screen and (min-width: 768px) {\r\n        @content;\r\n    }\r\n}\r\n\r\n@mixin mqTab() {\r\n    @media screen and (max-width: 1100px) {\r\n        @content;\r\n    }\r\n}\r\n\r\n@mixin mqSp() {\r\n    @media screen and (max-width: 768px) {\r\n        @content;\r\n    }\r\n}\r\n\r\n@mixin mqSsp() {\r\n    @media screen and (max-width: 480px) {\r\n        @content;\r\n    }\r\n}\r\n",".l {\r\n    &-hd {\r\n        width: calc(100% - 80px);\r\n        @include mqTab {\r\n            position: fixed;\r\n            width: 100%;\r\n            top: 0;\r\n            background-color: #696a6c;\r\n            z-index: 1005;\r\n        }\r\n        &-inn {\r\n            padding: 19px 30px 13px 50px;\r\n            background: #696a6c;\r\n            border-bottom: 1px solid #696a6c;\r\n            box-sizing: border-box;\r\n            @include mqTab {\r\n                padding: 10px 20px;\r\n            }\r\n            @include mqSp {\r\n                padding: 10px;\r\n            }\r\n            &-fl {\r\n                justify-content: space-between;\r\n                align-items: center;\r\n                @include mqTab {\r\n                    justify-content: center;\r\n                }\r\n            }\r\n            &-logo {\r\n                margin-left: 100px;\r\n                @include mqTab {\r\n                    margin-left: 0;\r\n                }\r\n                h1 {\r\n                    max-width: 130px;\r\n                    @include mqTab {\r\n                        max-width: 130px;\r\n                        display: block;\r\n                        margin: 0 auto;\r\n                    }\r\n                    @include mqSp {\r\n                        max-width: 72px;\r\n                    }\r\n                }\r\n                &-text {\r\n                    &.pc {\r\n                        @include mqTab {\r\n                            display: none;\r\n                        }\r\n                    }\r\n                    span {\r\n                        color: #fff;\r\n                        font-s